Deze toegang is vervaardigd met inachtneming van de volgende richtlijnen: 
                  S. Muller Fz., J.A. Feith en R. Fruin Th.Az., Handleiding voor het ordenen en beschrijven van archieven, ontworpen in opdracht van de Vereeniging van Archivarissen in Nederland, Erven B. van der Kamp, Groningen 1898;
                  S. Muller Fz., J.A. Feith en R. Fruin Th.Az., Handleiding voor het ordenen en beschrijven van archieven, ontworpen in opdracht van de Vereeniging van Archivarissen in Nederland, 2e druk, Erven B. van der Kamp, Groningen 1920

bioghist.p:
De werkzaamheden werden als volgt geregeld: 


Aan het ministerieel departement te rapporteren en te adviseren over alle zaken, die dat departement haar zal toezenden;

Aan het departement de voordrachten te doen, die zij ter bevordering der belangen van het Israëlitische kerkgenootschap of der bijzondere gemeenten nuttig oordeelt;

Het houden van goede correspondentie met de kerkelijke colleges der respectieve hoofd  en ringsynagogen en het toezicht, dat de verordeningen en bevelen van het gouvernement worden nagekomen en de bijzondere reglementen gehandhaafd;

De zorg, dat geschillen, welke in de Israëlitische gemeenten mochten ontstaan, op een billijke en zoveel mogelijk vriendelijke wijze worden getermineerd. Bij het onverhoopt mislukken van hare pogingen zal zij daarover verslag moeten doen aan het departement;

De nakoming van hetgeen haar bij de verordeningen op het godsdienstig onderwijs is opgedragen, en van alle bijzondere lastgevingen en commissies, als haar bij onderscheidene besluiten, disposities of reglementen opgedragen zijn of worden.

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 

U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;

Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;

In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;

Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;

Vervolgens bevestigt u uw reservering door deze te versturen.
